import React from "react";
import "./AdventureMap.css"; // Custom CSS for styling
import { Link } from "react-router-dom";

const levels = [
  {
    id: 1,
    name: "Forest Jump",
    status: "completed",
    icon: "üå≤",
    combos: [
      {
        id: "1-1",
        name: "Forest Trial I",
        exercises: [
          { type: "jump", reps: 10 },
          { type: "pushup", reps: 5 },
        ],
        status: "completed",
      },
      {
        id: "1-2",
        name: "Forest Trial II",
        exercises: [
          { type: "jump", reps: 20 },
          { type: "pushup", reps: 10 },
          { type: "squat", reps: 10 },
        ],
        status: "unlocked",
      },
      {
        id: "1-3",
        name: "Forest Trial III",
        exercises: [
          { type: "jump", reps: 40 },
          { type: "pushup", reps: 20 },
          { type: "plank", time: "30s" },
        ],
        status: "locked",
      },
    ],
  },
  // Add levels 2 to 5 similarly
];

function AdventureMap() {
  return (
    <div className="adventure-map-container">
      <h1 className="title">üèÅ Adventure Fitness Map</h1>
      <div className="map-path">
        {levels.map((level, index) => (
          <div key={level.id} className={`map-node ${level.status}`}>
            <div className="icon">{level.icon}</div>
            <div className="details">
              <h3>{level.name}</h3>
              <p>{level.task}</p>
              {level.status !== "locked" && (
                <Link
                  to={`/liveworkout?type=${level.name.toLowerCase()}`}
                  className="start-btn"
                >
                  Start
                </Link>
              )}
              {level.status === "locked" && (
                <button className="locked-btn" disabled>
                  Locked üîí
                </button>
              )}
            </div>
            {index < levels.length - 1 && <div className="map-line" />}
          </div>
        ))}
      </div>
    </div>
  );
}

export default AdventureMap;
